import UIKit

var (dogScreen, catScreen, birdScreen, bunnyScreen, fishScreen) = CreateAnimalScreens()
var currentAnimal = dogScreen


class ViewController: UIViewController {
¬†¬†¬†¬†
¬†¬†¬†¬†
¬†¬†¬†¬†@IBOutlet weak var animalBackground: UIView!

¬†¬†¬†¬†@IBOutlet weak var currentImage: UIImageView!
¬†¬†¬†¬†
¬†¬†¬†¬†@IBOutlet weak var foodImage: UIImageView!
¬†¬†¬†¬†
¬†¬†¬†¬†@IBOutlet weak var toyImage: UIImageView!
¬†¬†¬†¬†
¬†¬†¬†¬†@IBOutlet weak var happinessBar: DisplayView!
¬†¬†¬†¬†
¬†¬†¬†¬†@IBOutlet weak var playedLabel: UILabel!
¬†¬†¬†¬†
¬†¬†¬†¬†@IBOutlet weak var foodBar: DisplayView!
¬†¬†¬†¬†
¬†¬†¬†¬†@IBOutlet weak var fedLabel: UILabel!
¬†¬†¬†¬†
¬†¬†¬†¬†@IBOutlet weak var discoBall: UIImageView!
¬†¬†¬†¬†
¬†¬†¬†¬†@IBOutlet weak var discoButton: UIButton!
¬†¬†¬†¬†
¬†¬†¬†¬†var discoModeOn = false
¬†¬†¬†¬†var discoColor = 0;
¬†¬†¬†¬†var timer = Timer()
¬†¬†¬†¬†
¬†¬†¬†¬†
¬†¬†¬†¬†@IBAction func playButtonPressed(_ sender: Any) {
¬†¬†¬†¬†¬†¬†¬†¬†currentAnimal?.playWithAnimal()
¬†¬†¬†¬†¬†¬†¬†¬†updateLabelsAndBar(currentScreen: currentAnimal!)
¬†¬†¬†¬†¬†¬†¬†¬†toyAppearAndFade()
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†
¬†¬†¬†¬†@IBAction func feedButtonPressed(_ sender: Any) {
¬†¬†¬†¬†¬†¬†¬†¬†currentAnimal?.feedAnimal()
¬†¬†¬†¬†¬†¬†¬†¬†updateLabelsAndBar(currentScreen: currentAnimal!)
¬†¬†¬†¬†¬†¬†¬†¬†foodAppearAndFade()
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†
¬†¬†¬†¬†func updateScreen(newScreen:AnimalScreen){
¬†¬†¬†¬†¬†¬†¬†¬†// ensure disco mode is switched off
¬†¬†¬†¬†¬†¬†¬†¬†discoModeOn = false
¬†¬†¬†¬†¬†¬†¬†¬†timer.invalidate()
¬†¬†¬†¬†¬†¬†¬†¬†
¬†¬†¬†¬†¬†¬†¬†¬†// update the bars
¬†¬†¬†¬†¬†¬†¬†¬†happinessBar.color = newScreen.color
¬†¬†¬†¬†¬†¬†¬†¬†foodBar.color = newScreen.color
¬†¬†¬†¬†¬†¬†¬†¬†
¬†¬†¬†¬†¬†¬†¬†¬†// update colors, images, and labels
¬†¬†¬†¬†¬†¬†¬†¬†animalBackground.backgroundColor = newScreen.color
¬†¬†¬†¬†¬†¬†¬†¬†currentImage.image = newScreen.image
¬†¬†¬†¬†¬†¬†¬†¬†foodImage.image = newScreen.food.image
¬†¬†¬†¬†¬†¬†¬†¬†toyImage.image = newScreen.toy.image
¬†¬†¬†¬†¬†¬†¬†¬†updateLabelsAndBar(currentScreen: newScreen)
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†func updateLabelsAndBar(currentScreen:AnimalScreen){
¬†¬†¬†¬†¬†¬†¬†¬†happinessBar.animateValue(to: CGFloat(currentScreen.happinessLevel)/10.0)
¬†¬†¬†¬†¬†¬†¬†¬†foodBar.animateValue(to: CGFloat(currentScreen.foodLevel)/10.0)
¬†¬†¬†¬†¬†¬†¬†¬†playedLabel.text = "played: " + String(currentScreen.timesPlayed)
¬†¬†¬†¬†¬†¬†¬†¬†fedLabel.text = "fed: " + String(currentScreen.timesFed)
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†func foodAppearAndFade(){
¬†¬†¬†¬†¬†¬†¬†¬†foodImage.isHidden = false
¬†¬†¬†¬†¬†¬†¬†¬†foodImage.alpha = 1.0;
¬†¬†¬†¬†¬†¬†¬†¬†UIView.animate(withDuration: 0.3, animations: {
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†self.foodImage.alpha = 0.0
¬†¬†¬†¬†¬†¬†¬†¬†}, completion: {
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†(value: Bool) in
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†self.foodImage.isHidden = true
¬†¬†¬†¬†¬†¬†¬†¬†})
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†func toyAppearAndFade(){
¬†¬†¬†¬†¬†¬†¬†¬†toyImage.isHidden = false
¬†¬†¬†¬†¬†¬†¬†¬†toyImage.alpha = 1.0;
¬†¬†¬†¬†¬†¬†¬†¬†UIView.animate(withDuration: 0.3, animations: {
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†self.toyImage.alpha = 0.0
¬†¬†¬†¬†¬†¬†¬†¬†}, completion: {
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†(value: Bool) in
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†self.toyImage.isHidden = true
¬†¬†¬†¬†¬†¬†¬†¬†})
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†@IBAction func switchToDog(_ sender: Any) {
¬†¬†¬†¬†¬†¬†¬†¬†currentAnimal = dogScreen
¬†¬†¬†¬†¬†¬†¬†¬†updateScreen(newScreen: currentAnimal!)
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†@IBAction func switchToCat(_ sender: Any) {
¬†¬†¬†¬†¬†¬†¬†¬†currentAnimal = catScreen
¬†¬†¬†¬†¬†¬†¬†¬†updateScreen(newScreen: currentAnimal!)
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†@IBAction func switchToBird(_ sender: Any) {
¬†¬†¬†¬†¬†¬†¬†¬†currentAnimal = birdScreen
¬†¬†¬†¬†¬†¬†¬†¬†updateScreen(newScreen: currentAnimal!)
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†@IBAction func switchToBunny(_ sender: Any) {
¬†¬†¬†¬†¬†¬†¬†¬†currentAnimal = bunnyScreen
¬†¬†¬†¬†¬†¬†¬†¬†updateScreen(newScreen: currentAnimal!)
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†@IBAction func switchToFish(_ sender: Any) {
¬†¬†¬†¬†¬†¬†¬†¬†currentAnimal = fishScreen
¬†¬†¬†¬†¬†¬†¬†¬†updateScreen(newScreen: currentAnimal!)
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†
¬†¬†¬†¬†func loadDefaultDog(){
¬†¬†¬†¬†¬†¬†¬†¬†currentImage.image = #imageLiteral(resourceName: "dog")
¬†¬†¬†¬†¬†¬†¬†¬†foodImage.image = #imageLiteral(resourceName: "kibble")
¬†¬†¬†¬†¬†¬†¬†¬†foodImage.alpha = 0
¬†¬†¬†¬†¬†¬†¬†¬†toyImage.image = #imageLiteral(resourceName: "bone")
¬†¬†¬†¬†¬†¬†¬†¬†toyImage.alpha = 0
¬†¬†¬†¬†¬†¬†¬†¬†animalBackground.backgroundColor = UIColor.blue
¬†¬†¬†¬†¬†¬†¬†¬†foodBar.color = UIColor.blue
¬†¬†¬†¬†¬†¬†¬†¬†happinessBar.color = UIColor.blue
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†@IBAction func discoButtonPressed(_ sender: Any) {
¬†¬†¬†¬†¬†¬†¬†¬†if discoModeOn == true {
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†timer.invalidate()
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†discoModeOn = false
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†animalBackground.backgroundColor = currentAnimal?.color
¬†¬†¬†¬†¬†¬†¬†¬†} else{
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†discoModeOn = true
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†discoTimer()
¬†¬†¬†¬†¬†¬†¬†¬†}
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†func discoBackground(){
¬†¬†¬†¬†¬†¬†¬†¬†if discoModeOn == true {
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†let colors: [UIColor] = [UIColor.purple, UIColor.magenta, UIColor.blue, UIColor.red, UIColor.orange, UIColor.yellow, UIColor.cyan, UIColor.green,UIColor.blue,UIColor.magenta,UIColor.orange,UIColor.cyan,]
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†self.animalBackground.backgroundColor = colors[self.discoColor]
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†discoColor += 1
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†if discoColor == colors.count{
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†discoColor = 0
¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†¬†}
¬†¬†¬†¬†¬†¬†¬†¬†}
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†func animalDance(){
¬†¬†¬†¬†¬†¬†¬†¬†let animation = CABasicAnimation(keyPath: "position")
¬†¬†¬†¬†¬†¬†¬†¬†animation.duration = 0.125
¬†¬†¬†¬†¬†¬†¬†¬†animation.repeatCount = 0
¬†¬†¬†¬†¬†¬†¬†¬†animation.autoreverses = true
¬†¬†¬†¬†¬†¬†¬†¬†animation.fromValue = NSValue(cgPoint: CGPoint(x: self.currentImage.center.x, y: self.currentImage.center.y - 10))
¬†¬†¬†¬†¬†¬†¬†¬†animation.toValue = NSValue(cgPoint: CGPoint(x: self.currentImage.center.x, y: self.currentImage.center.y + 10))
¬†¬†¬†¬†¬†¬†¬†¬†self.currentImage.layer.add(animation, forKey: "position")
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†func discoColorAndDance(){
¬†¬†¬†¬†¬†¬†¬†¬†animalDance()
¬†¬†¬†¬†¬†¬†¬†¬†discoBackground()
¬†¬†¬†¬†}
¬†¬†¬†¬†
¬†¬†¬†¬†func discoTimer(){
¬†¬†¬†¬†¬†¬†¬†¬†timer = Timer.scheduledTimer(timeInterval: 0.25, target: self, selector: #selector(ViewController.discoColorAndDance), userInfo: nil, repeats: true)
¬†¬†¬†¬†}
¬†¬†¬†¬†

¬†¬†¬†¬†override func viewDidLoad() {
¬†¬†¬†¬†¬†¬†¬†¬†super.viewDidLoad()
¬†¬†¬†¬†¬†¬†¬†¬†
¬†¬†¬†¬†¬†¬†¬†¬†// defaulting to dog colors
¬†¬†¬†¬†¬†¬†¬†¬†loadDefaultDog()
¬†¬†¬†¬†}

¬†¬†¬†¬†override func didReceiveMemoryWarning() {
¬†¬†¬†¬†¬†¬†¬†¬†super.didReceiveMemoryWarning()
¬†¬†¬†¬†¬†¬†¬†¬†// Dispose of any resources that can be recreated.
¬†¬†¬†¬†}


}

