import UIKit

class ViewController: UIViewController {

    @IBOutlet weak var petBackground: UIView!
    @IBOutlet weak var petView: UIImageView!

    @IBOutlet weak var happinessBar: DisplayView!
    @IBOutlet weak var foodBar: DisplayView!

    @IBOutlet weak var play: UIButton!
    @IBOutlet weak var feed: UIButton!

    @IBOutlet weak var timesPlayedLabel: UILabel!
    @IBOutlet weak var timesFedLabel: UILabel!
    @IBOutlet weak var message: UILabel!


    override func viewDidLoad() {
        super.viewDidLoad()
        updatePetViews()
        message.alpha = 0
        happinessBar.value = CGFloat(0.0)
    }

    override func didReceiveMemoryWarning() {
        super.didReceiveMemoryWarning()
        // Dispose of any resources that can be recreated.
    }

    @IBAction func feedPet(_ sender: Any) {
        if curPet.feed() {
            updatePetViews()
        }
        else {
            messageUser("Your pet is full, play with it!")
        }
    }

    @IBAction func playPet(_ sender: Any) {
        if curPet.play() {
            updatePetViews()
        }
        else {
            messageUser("Your pet is too hungry to play!")
        }
    }

    @IBAction func petChange(pet: UIButton) {
        if let petName : String = pet.currentTitle {
            curPet = allPets[petName]!
            updatePetViews()
        }
    }

    func updatePetViews() {
        updateColors(aColor: curPet.petColor)
        petView.image = curPet.petImage
        timesPlayedLabel.text = "played : \(curPet.timesPlayed)"
        timesFedLabel.text = "fed : \(curPet.timesFed)"
    }

    func updateColors(aColor: UIColor) {
        petBackground.backgroundColor = aColor
    }

    func messageUser(_ messageData : String) {
    message.text = messageData
    message.alpha = 1
    //  Animation code interpreted from Stack Overflow example and Apple Developer swift reference.
    UILabel.animate(withDuration: 1, delay: 1, options: UIViewAnimationOptions.curveEaseOut, animations: {
        self.message.alpha = 0.0})
    }
}
